import React from 'react';
import {Link, Router}  from 'react';



function Navbar(){
    return (
        <Router>
            <div>
              <nav className="navbar navbar-expand-lg navbar-light bg-light">
              <ul className="navbar-nav mr-auto">
                <li><Link to={'/Weather.js'} className="nav-link"> Home </Link></li>
                <li><Link to={'/Fiveday.js'} className="nav-link">Contact</Link></li>
              </ul>
              </nav>
              <hr />
            </div>
          </Router>
        );
    }
export default Navbar;
